import React from 'react';
//import PropTypes from 'prop-types';

import './sideBar.scss';

const SideBarTitle = () => {
    return (
        <div className="sidebar-title">
            <span>UTMMMMM</span>
        </div>
    )
}

const SideBarItem = () => {
    return (
        <div className="sidebar-item">
            <span>UTMMMMM</span>
        </div>
    )
}

class SideBar extends React.Component {
    render() {
         return(
             <div>
                 <SideBarTitle />
                 <SideBarItem />
             </div>

         );
    }
}

export default SideBar;
